import Post from "./Post";

export default function ItemList(props) {
  return (
    <div class="list-group list-group-flush">
      <br></br>
      
      <br></br>
      
      <div href="#" class="list-group-item rounded d-flex flex-column">
        <Post onSkim={props.onSkim}></Post>
      </div>
    </div>
  );
}
